// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/math/Math.sol";

contract NftTrader {
    // Address of ERC721 contract owned by Galaxy => (tokenId => offer details)
    mapping(address => mapping(uint256 => TimedOffer)) public timedOffers;
    mapping(address => mapping(uint256 => ConstantOffer)) public constantOffers;
    address payable public tradeOwner;

    struct TimedOffer {
        uint256 createdAt;
        uint256 dayPriceChange;
        uint256 minPrice;
        uint256 maxPrice;
        bool isSet;
    }

    struct ConstantOffer {
        uint256 price;
        bool isSet;
    }

    constructor () payable {
        tradeOwner = payable(msg.sender);
    }

    function setOwner(address payable newOwner) public {
        require(msg.sender == tradeOwner, "Is not owner of the trade contract");
        tradeOwner = newOwner;
    }

    function addTimedOffer(
        uint256 dayPriceChange,
        uint256 minPrice,
        uint256 maxPrice,
        address contractAddr,
        uint256 tokenId
    ) public {
        require(msg.sender == tradeOwner, "Is not owner of the trade contract");

        ERC721 token = ERC721(contractAddr);
        require(token.ownerOf(tokenId) == tradeOwner, "Is not owner of ERC721 token");

        timedOffers[contractAddr][tokenId] = TimedOffer(
            block.timestamp,
            dayPriceChange,
            minPrice,
            maxPrice,
            true
        );
    }

    function offsetTimedOffer(
        int256 offsetSeconds,
        address contractAddr,
        uint256 tokenId
    ) public {
        require(msg.sender == tradeOwner, "Is not owner of the trade contract");

        TimedOffer storage offer = timedOffers[contractAddr][tokenId];
        require(offer.isSet, "Offer not found");

        offer.createdAt += uint256(offsetSeconds);
    }

    function deleteTimedOffer(address contractAddr, uint256 tokenId) public {
        require(msg.sender == tradeOwner, "Is not owner of the trade contract");
        delete timedOffers[contractAddr][tokenId];
    }

    function timedPurchase(address contractAddr, uint256 tokenId) public payable {
        TimedOffer memory offer = timedOffers[contractAddr][tokenId];
        require(offer.isSet, "Offer not found");
        require(msg.value >= getTimedPrice(contractAddr, tokenId), "Insufficient funds sent");

        ERC721 token = ERC721(contractAddr);
        token.safeTransferFrom(tradeOwner, msg.sender, tokenId);
        delete timedOffers[contractAddr][tokenId];
    }

    function getTimedPrice(address contractAddr, uint256 tokenId) public view returns (
        uint256 currentPrice
    ){
        TimedOffer memory offer = timedOffers[contractAddr][tokenId];
        if (offer.isSet) {
            uint256 daysPassed = SafeMath.div(
                SafeMath.sub(block.timestamp, offer.createdAt), 3600 * 24
            );
            uint256 calculatedPrice = SafeMath.sub(
                offer.maxPrice, SafeMath.mul(daysPassed, offer.dayPriceChange)
            );
            currentPrice = Math.max(offer.minPrice, calculatedPrice);
        }
        else {
            currentPrice = 0;
        }
    }

    function getTimedOffer(address contractAddr, uint256 tokenId) public view returns (
        uint256 minPrice,
        uint256 currentPrice,
        bool isSet
    ) {
        TimedOffer memory offer = timedOffers[contractAddr][tokenId];
        minPrice = offer.minPrice;
        isSet = offer.isSet;
        currentPrice = getTimedPrice(contractAddr, tokenId);
    }

    function addConstantOffer(
        uint256 price,
        address contractAddr,
        uint256 tokenId
    ) public {
        require(msg.sender == tradeOwner, "Is not owner of the trade contract");

        ERC721 token = ERC721(contractAddr);
        require(token.ownerOf(tokenId) == tradeOwner, "Is not owner of ERC721 token");

        constantOffers[contractAddr][tokenId] = ConstantOffer(price, true);
    }

    function deleteConstantOffer(address contractAddr, uint256 tokenId) public {
        require(msg.sender == tradeOwner, "Is not owner of the trade contract");
        delete constantOffers[contractAddr][tokenId];
    }

    function constantPurchase(address contractAddr, uint256 tokenId) public payable {
        ConstantOffer memory offer = constantOffers[contractAddr][tokenId];
        require(offer.isSet, "Offer not found");
        require(msg.value >= offer.price, "Insufficient funds sent");

        ERC721 token = ERC721(contractAddr);
        token.safeTransferFrom(tradeOwner, msg.sender, tokenId);
        delete constantOffers[contractAddr][tokenId];
    }

    function withdraw() public {
        require(msg.sender == tradeOwner, "Is not owner of the trade contract");
        uint256 amount = address(this).balance;
        (bool success,) = tradeOwner.call{value : amount}("");
        require(success, "Failed to send Ether");
    }

    function getBalance() public view returns (uint256 balance){
        require(msg.sender == tradeOwner, "Is not owner of the trade contract");
        balance = address(this).balance;
    }
}
